import React from 'react';
import './style.css'
import { useState } from 'react';

function Square(){
    const [vlaue, setValue] = useState(null)

    function hendClick(){
        setValue('X')
    }
    return(
        <button onClick={hendClick} className='square'>{vlaue}
        </button>
    )
}


function Board() {
    return (
        <div>
            <div className='board-row'>
                <Square/>
                <Square/>
                <Square/>
            </div>
            <div className='board-row'>
                <Square/>
                <Square/>
                <Square/>
            </div>
            <div className='board-row'>
                <Square/>
                <Square/>
                <Square/>
            </div>
        </div>
    )
  }

  export default function App(){
    return(
        <Board/>
    )
  }
